import './FFNav.css';

export default function FFNav() {
  return (
    <aside>
      <nav className="side-menu">
        <h2>Menu</h2>
        <h4>Item 1</h4>
        <h4>Item 2</h4>
      </nav>
    </aside>
  )
}
